import React from 'react'
import MovieCard from '../Movie Card Component/MovieCard'

export default function MoviesList(props) {
    return (
        <React.Fragment>
            {
                props.movies.map((movie)=> <MovieCard/>)
            }
        </React.Fragment>
    )
}
